import execjs
import json
def get_js():
    f = open('./test_jsfcrypto.js','r',encoding = 'utf-8')
    line = f.readline()
    htmlstr =  ' '
    while line :
        htmlstr = htmlstr + line
        line = f.readline()
    return htmlstr


def get_test():
    ctx = execjs.compile("function test(a){"
                         "return a }")
    testdata = ctx.call("test",1)
    return testdata
def get_data(data):
    js_str = get_js()
    print(js_str)
    ctx = execjs.compile(js_str)
    data = ctx.call("Decrypt",data)
    return data

if __name__ == "__main__":
    res = '{"sign":"","data":""}'
    # print(get_test())
    res = json.loads(res)
    data = res['data']

    data = get_data(data)
